import CardContent from "@mui/material/CardContent";
import CardHeader from "@mui/material/CardHeader"
function App() {
  return (
    <div>
      <CardHeader>
         Encabezado
      </CardHeader>
      <CardContent>
        <Menu altura={5} />
      </CardContent>
    </div>
  );
}

export default App;
